import React from 'react'
import { StyleSheet, Image, Text, View, Button, ImageBackground, TouchableOpacity } from 'react-native'
import background from '../../assets/LoginBackgroud.png'

export default function Landing({ navigation }) {
    const styles = StyleSheet.create({
        backgroundContainer : {
            flex : 1,
            justifyContent : 'flex-end',
            alignItems : 'center'
        },
        container : {
            flex : 1,
        },
        button : {
            backgroundColor : '#00C853',
            marginTop : 30,
            height : 50,
            textAlign : 'center',
            alignItems : 'center',
            justifyContent : 'center'
        }
    });
    return (
        <ImageBackground source = {background} style = {styles.backgroundContainer}>
            <View styles = {styles.container}>
                <TouchableOpacity 
                    style = {styles.button}
                    onPress={() => navigation.navigate("Register")}>
                    <Text style = {{color : '#FFFFFF'}}>회원 가입</Text>
                </TouchableOpacity>
                <TouchableOpacity 
                    style = {styles.button}
                    onPress={() => navigation.navigate("Login")}>
                    <Text style = {{color : '#FFFFFF'}}>로그인</Text>
                </TouchableOpacity>
            </View>
        </ImageBackground>
    )

}
